import React from "react";
import Menutabs from "./Menutabs";

export default function AddEmployee({ match }) {
  return (
    <div className="flex flex-col h-screen mb-2">
      {!match && <Menutabs />}
      <div className="flex flex-1 bg-white rounded-md p-2 top-2">
        <div className="flex">
          <div className="bg-blue-400 w-64">Sider</div>
          <div>Main Content</div>
        </div>
      </div>
    </div>
  );
}
